import styled from "styled-components";

const LoaderContainer = styled.div`
  width: 30%;
  height: 60%;
  display: flex;
  border: 2px solid grey;
  margin: 90px auto;
`;

const LoaderItem = styled.div`
  border: 10px solid red;
  align-self: center;
`;

const Loader = () => {
  return (
    <LoaderContainer>
      <LoaderItem />
    </LoaderContainer>
  );
};

export default Loader;
